UPDATE OUT_PAYMENT_DETAIL P SET (TXT_STATUS, DTE_UPDATE) = (SELECT 'DELETE',SYSDATE FROM DUAL) WHERE TXT_STATUS = 'ACTIVE' AND EXISTS (SELECT 1 FROM IN_ETL_CONTROL ICTRLDATE, IN_ETL_CONTROL ICTRLTYPE, IN_ETL_CONTROL ICTRLMAXDT WHERE ICTRLDATE.TXT_KEY_STRING = 'OPER_CYCLE_DATE' AND ICTRLDATE.TXT_FILE_NAME='GLOBAL' AND ICTRLTYPE.TXT_KEY_STRING='$$STR_PAYMENT_CYCLE_TYPE' AND ICTRLTYPE.TXT_FILE_NAME='$$STR_PROCESSING_UNIT' AND P.DTE_CYCLE_DATE = TO_DATE(ICTRLDATE.TXT_KEY_VALUE,'YYYY-MM-DD') AND P.TXT_CYCLE_TYPE = ICTRLTYPE.TXT_KEY_VALUE AND P.TXT_PROCESSING_UNIT=ICTRLTYPE.TXT_FILE_NAME AND ICTRLMAXDT.TXT_KEY_STRING='$$STR_MAX_CYCLE_DATE' AND ICTRLMAXDT.TXT_FILE_NAME='$$STR_PROCESSING_UNIT' AND NVL(ICTRLMAXDT.dec_enforce_flg,0) !=2 );
UPDATE OUT_PAYMENT_DETAIL_TRACE SET (TXT_STATUS, DTE_UPDATE) = (SELECT 'DELETE',SYSDATE FROM DUAL) WHERE txt_status ='ACTIVE' AND dec_paymentdetailseq IN ( SELECT dec_paymentdetailseq FROM OUT_PAYMENT_DETAIL WHERE txt_status ='DELETE' );
COMMIT;
